class Tags:
    """
    Collection of standard SMPP TLV tags.
    """

    _pointer: ctypes.c_void_p
    
    def __init__(self, *args, **kwargs):
        raise ValueError("This class has no default constructor")

    def __del__(self):
        # In case of partial initialization of instances.
        pointer = getattr(self, "_pointer", None)
        if pointer is not None:
            _uniffi_rust_call(_UniffiLib.uniffi_smpp_codec_ffi_fn_free_tags, pointer)

    def _uniffi_clone_pointer(self):
        return _uniffi_rust_call(_UniffiLib.uniffi_smpp_codec_ffi_fn_clone_tags, self._pointer)

    # Used by alternative constructors or any methods which return this type.
    @classmethod
    def _make_instance_(cls, pointer):
        # Lightly yucky way to bypass the usual __init__ logic
        # and just create a new instance with the required pointer.
        inst = cls.__new__(cls)
        inst._pointer = pointer
        return inst



class _UniffiConverterTypeTags:

    @staticmethod
    def lift(value: int):
        return Tags._make_instance_(value)

    @staticmethod
    def check_lower(value: Tags):
        if not isinstance(value, Tags):
            raise TypeError("Expected Tags instance, {} found".format(type(value).__name__))

    @staticmethod
    def lower(value: TagsProtocol):
        if not isinstance(value, Tags):
            raise TypeError("Expected Tags instance, {} found".format(type(value).__name__))
        return value._uniffi_clone_pointer()

    @classmethod
    def read(cls, buf: _UniffiRustBuffer):
        ptr = buf.read_u64()
        if ptr == 0:
            raise InternalError("Raw pointer value was null")
        return cls.lift(ptr)

    @classmethod
    def write(cls, value: TagsProtocol, buf: _UniffiRustBuffer):
        buf.write_u64(cls.lower(value))


