# SmppFfiError
# We want to define each variant as a nested class that's also a subclass,
# which is tricky in Python.  To accomplish this we're going to create each
# class separately, then manually add the child classes to the base class's
# __dict__.  All of this happens in dummy class to avoid polluting the module
# namespace.
class SmppFfiError(Exception):
    """
    Common error type for FFI operations.
    """

    pass

_UniffiTempSmppFfiError = SmppFfiError

class SmppFfiError:  # type: ignore
    """
    Common error type for FFI operations.
    """

    class Generic(_UniffiTempSmppFfiError):
        """
        Generic error with a message.
        """

        def __init__(self, msg):
            super().__init__(", ".join([
                "msg={!r}".format(msg),
            ]))
            self.msg = msg

        def __repr__(self):
            return "SmppFfiError.Generic({})".format(str(self))
    _UniffiTempSmppFfiError.Generic = Generic # type: ignore

SmppFfiError = _UniffiTempSmppFfiError # type: ignore
del _UniffiTempSmppFfiError


class _UniffiConverterTypeSmppFfiError(_UniffiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.read_i32()
        if variant == 1:
            return SmppFfiError.Generic(
                _UniffiConverterString.read(buf),
            )
        raise InternalError("Raw enum value doesn't match any cases")

    @staticmethod
    def check_lower(value):
        if isinstance(value, SmppFfiError.Generic):
            _UniffiConverterString.check_lower(value.msg)
            return

    @staticmethod
    def write(value, buf):
        if isinstance(value, SmppFfiError.Generic):
            buf.write_i32(1)
            _UniffiConverterString.write(value.msg, buf)





